### FILE: client/src/components/UserProfile.tsx

import React from 'react';

type UserProfileProps = {
  avatar?: string;
  username: string;
  occupation?: string;
  bio?: string;
};

const cardStyle: React.CSSProperties = {
  display: 'flex',
  alignItems: 'center',
  padding: '16px',
  borderRadius: '12px',
  background: '#fff',
  boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
  border: '1px solid #eee',
  maxWidth: '420px'
};

const avatarStyle: React.CSSProperties = {
  width: '64px',
  height: '64px',
  borderRadius: '50%',
  objectFit: 'cover',
  marginRight: '16px',
  background: '#ddd'
};

const contentStyle: React.CSSProperties = {
  display: 'flex',
  flexDirection: 'column'
};

const usernameStyle: React.CSSProperties = {
  fontSize: '18px',
  fontWeight: 600,
  margin: 0
};

const occupationStyle: React.CSSProperties = {
  fontSize: '14px',
  color: '#666',
  marginTop: '4px'
};

const bioStyle: React.CSSProperties = {
  fontSize: '13px',
  color: '#555',
  marginTop: '6px',
  lineHeight: 1.4
};

const UserProfile: React.FC<UserProfileProps> = ({ avatar, username, occupation, bio }) => {
  return (
    <div style={cardStyle} aria-label={`User profile: ${username}`}>
      <img
        src={avatar || 'https://via.placeholder.com/64'}
        alt={`${username} avatar`}
        style={avatarStyle}
      />
      <div style={contentStyle}>
        <p style={usernameStyle}>{username}</p>
        {occupation && <span style={occupationStyle}>{occupation}</span>}
        {bio && <span style={bioStyle}>{bio}</span>}
      </div>
    </div>
  );
};

export default UserProfile;

### END_FILE
